DROP TABLE IF EXISTS osm_countries;
CREATE TABLE osm_countries (
    osm_id INTEGER,
    iso_code varchar(2),
    name varchar(30),
    name_en varchar(30),
    name_de varchar(30),
    name_fr varchar(30),
    name_es varchar(30),
    name_ru varchar(30),
    name_zh varchar(30),
    scalerank integer,
    geometry geometry,
    id integer primary key
);
SELECT UpdateGeometrySRID('osm_countries', 'geometry', 4326);

